function Header(props) {

    const styles = {
        navBar: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            padding: '9px 3%'
        },
        links: {
            textDecoration: 'none'
        }
    }

    return (
        <header>
        <nav style={styles.navBar}>
            <ul>
                <a href='/'>Home</a>
                <a href='/about-me'>About Me</a>
                <a href='/projects'>Projects</a>
                <a href='/contact'>Contact</a>
            </ul>
            <h3 href='/'>{props.title}</h3>
        </nav>
        </header>
    )
  }

  export default Header;
